//STEP000  EXEC PGM=IDCAMS
//SYSPRINT DD SYSOUT=*
//SYSIN    DD *
      DELETE IBMUSER.SMF.SMF110.SUB1.V
      SET MAXCC=0
/*
//***********************************************************
//*  STEP 2: UNLOAD DATA FROM THE SMF DATA SETS
//***********************************************************
//STEP001  EXEC PGM=IFASMFDP,COND=(7,LE)
//INDD1   DD DSN=SYS1.MAN3,DISP=SHR
//OUTDD1  DD DSN=IBMUSER.SMF.SMF110.SUB1.V,DISP=(NEW,CATLG),
//        SPACE=(CYL,(500,100),RLSE),UNIT=3390,VOL=SER=Z3SMS3
//SYSPRINT DD SYSOUT=A
//SYSIN    DD *
 INDD(INDD1,OPTIONS(DUMP))
 OUTDD(OUTDD1,TYPE(110(1)))
/*
//STEP002  EXEC PGM=IDCAMS
//SYSPRINT DD SYSOUT=*
//SYSIN    DD *
      DELETE IBMUSER.SMF.SMF110.SUB1.V.PZ
      SET MAXCC=0
/*
//STEP003  EXEC PGM=SORT,REGION=6000K,COND=(7,LE)
//SYSOUT   DD SYSOUT=*
//SORTWK01 DD UNIT=3390,SPACE=(CYL,300)
//SORTWK02 DD UNIT=3390,SPACE=(CYL,300)
//SORTWK03 DD UNIT=3390,SPACE=(CYL,300)
//SORTIN   DD DSN=IBMUSER.SMF.SMF110.SUB1.V,DISP=SHR
//SORTOUT  DD DSN=IBMUSER.SMF.SMF110.SUB1.V.PZ,DISP=(NEW,CATLG,DELETE),
//            SPACE=(TRK,(900,600),RLSE),DCB=(LRECL=32756,RECFM=VB),
//            VOL=SER=Z3WK07,UNIT=3390
//SYSIN    DD *
    OPTION VLSHRT,DYNALLOC,NOBLKSET
    SORT FIELDS=COPY
//*
//STEP006  EXEC PGM=IDCAMS,COND=(7,LE)
//SYSPRINT DD SYSOUT=*
//SYSIN    DD *
      DELETE IBMUSER.SMF.SMF110.SUB1
      SET MAXCC=0
/*
//STEP007  EXEC PGM=IDCAMS,COND=(7,LE)
//SYSPRINT DD SYSOUT=*
//SYSIN    DD *
      DELETE IBMUSER.SMF.SMF110.SUB1.V.PZ.RPT
      SET MAXCC=0
/*
//STEP008  EXEC PGM=SMF110S1,COND=(7,LE)
//STEPLIB  DD  DISP=SHR,DSN=SYS1.PROG.LOAD.KANG
//SMF110IN DD  DSN=IBMUSER.SMF.SMF110.SUB1.V.PZ,DISP=SHR
//SMF110MN DD  DSN=IBMUSER.SMF.SMF110.SUB1.V.PZ.RPT,
//             DISP=(NEW,CATLG,DELETE),
//             DCB=(RECFM=FB,DSORG=PS,LRECL=154,BLKSIZE=0),
//             VOL=SER=Z3SMS3,
//             SPACE=(TRK,(2000,1000),RLSE),UNIT=SYSDA
//SYSOUT    DD SYSOUT=*
//SYSPRINT  DD SYSOUT=*
//SYSIN     DD *
CICS TRAN=NO         :should be YES or NO
TRAN=PBV*            :Transaction ID
20010215072504286290 :Transaction Start Time CCYYMMDDHHMMSSMXXXXX
20100215093504286290 :Transaction End Time CCYYMMDDHHMMSSMXXXXX
